import Navbar from "./Navbar";
import { Box, ListItem, ListItemText, ListSubheader } from "@mui/material";

const Home = () => {
  return (
    <div>
      <Navbar />
      <p>Welcome, user</p>
      <Box
        sx={{
          width: "100%",
          height: 400,
          maxWidth: 360,
          bgcolor: "pink",
        }}
      >
          <ListSubJeader></ListSubJeader>
        <ListItem>
          <ListItemText component="div">first</ListItemText>
          <ListItemText component="div">second</ListItemText>
        </ListItem>
        <ListItem>
          <ListItemText component="div">first</ListItemText>
          <ListItemText component="div">second</ListItemText>
        </ListItem>
      </Box>
    </div>
  );
};

export default Home;
